import React, { useEffect, useState } from 'react';
import api from '../services/api';
import { Container, Grid, Typography, Table, TableHead, TableRow, TableCell, TableBody } from '@mui/material';
import DashboardCard from '../components/DashboardCard';

export default function Dashboard() {
  const [health, setHealth] = useState('...');
  const [students, setStudents] = useState([]);
  const [attendance, setAttendance] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const healthRes = await api.get('/api/v1/health');
        setHealth(healthRes.data.status);
      } catch {
        setHealth('unreachable');
      }

      try {
        const studentsRes = await api.get('/api/v1/students');
        setStudents(studentsRes.data || []);
      } catch {
        setStudents([]);
      }

      try {
        const attendanceRes = await api.get('/api/v1/attendance');
        setAttendance(attendanceRes.data || []);
      } catch {
        setAttendance([]);
      }
    };

    fetchData();
  }, []);

  const studentsCount = Array.isArray(students) ? students.length : '--';
  const attendancePct =
    Array.isArray(attendance) && studentsCount > 0
      ? `${Math.round((attendance.length / Math.max(1, studentsCount)) * 100)}%`
      : '--';

  return (
    <Container sx={{ mt: 3 }}>
      <Typography variant="h4" sx={{ mb: 3 }}>
        Dashboard
      </Typography>

      <Grid container spacing={3}>
        {/* Summary Cards */}
        <Grid item xs={12} md={4}>
          <DashboardCard title="Backend Health" value={health} subtitle="API status" accent="#1976d2" />
        </Grid>
        <Grid item xs={12} md={4}>
          <DashboardCard title="Total Students" value={studentsCount} subtitle="Registered students" accent="#00acc1" />
        </Grid>
        <Grid item xs={12} md={4}>
          <DashboardCard
            title="Today's Attendance"
            value={attendancePct}
            subtitle={`${attendance.length || 0} records`}
            accent="#2e7d32"
          />
        </Grid>

        {/* Recent Attendance Table */}
        <Grid item xs={12} md={8}>
          <Typography variant="h6" sx={{ mb: 1 }}>
            Recent Attendance
          </Typography>
          <div
            style={{
              background: '#fff',
              padding: 16,
              borderRadius: 8,
              boxShadow: '0 6px 20px rgba(15,23,42,0.04)',
            }}
          >
            <Table size="small">
              <TableHead>
                <TableRow>
                  <TableCell>Student</TableCell>
                  <TableCell>Method</TableCell>
                  <TableCell>Location</TableCell>
                  <TableCell>Timestamp</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {attendance.slice(0, 10).map(({ id, student_id, method, location, timestamp }) => (
                  <TableRow key={id}>
                    <TableCell>{student_id}</TableCell>
                    <TableCell>{method}</TableCell>
                    <TableCell>{location}</TableCell>
                    <TableCell>{new Date(timestamp).toLocaleString()}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </div>
        </Grid>

        {/* Quick Actions */}
        <Grid item xs={12} md={4}>
          <Typography variant="h6" sx={{ mb: 1 }}>
            Quick Actions
          </Typography>
          <div
            style={{
              background: '#fff',
              padding: 16,
              borderRadius: 8,
              boxShadow: '0 6px 20px rgba(15,23,42,0.04)',
            }}
          >
            <p style={{ margin: 0 }}>• Use the Students page to view the full list.</p>
            <p style={{ marginTop: 8 }}>• Use Attendance for details and exports.</p>
          </div>
        </Grid>
      </Grid>
    </Container>
  );
}
